Tag SNPs are imperfectly correlated with causal variant

sim &lt;- function(nid=10000, nsnp=10)
{
  g &lt;- matrix(0, nid, nsnp)
  g[,1] &lt;- rnorm(nid)
  for(i in 2:nsnp)
  {
    g[,i] &lt;- g[,i] + rnorm(nid, sd=0.5)
  }
  y &lt;- g[,1] + rnorm(nid)
  summary(lm(y ~ g[,1]))
  grs &lt;- rowSums(g)
  return(c(cor(y, g[,1])^2, cor(y, grs)^2))
}
