Now the GRS doesn’t work well because it includes the variance of the SNP + noise that isn’t causally related to the trait.
\[
r^2 = \frac{cov(grs, y)^2}{var(grs) var(y)}
\]
i.e. cov(grs,y) isn’t increasing, but (var(y)) is.
